(45, 21, 'priya@gmail.com', 'test', 'work', 'Module 2\r\n\r\n4) PERFORMING AN IN-DEPTH LIVE RESPONSE\r\n\r\nâ€¢	Sometimes, your response at the console of a live system needs to go beyond merely obtaining the volatile information. Perhaps shutting off the target system is not even an option\r\nâ€¢	You may need to find evidence and properly remove malicious programs without disrupting any services provided by the victim machine. you will not be able to shut off the machine, disable network connections\r\n\r\n1.	Collecting the Most Volatile Data\r\nâ€¢	Run the date and time commands\r\nâ–  Use PsLoggedOn to see who is currently connected to the system.\r\nâ–  Use netstat to view current and recent connections on all listening ports.\r\nâ–  Run PsList to see all the running processes.\r\nâ–² Use Fport to determine which programs have opened specific ports.\r\nAfter gathering this information, you can continue with some investigative steps that\r\nminimize the disruption of a target systemâ€™s operation.\r\n\r\n2.	Creating an In-Depth Response Toolkit\r\n   To perform an in-depth live response, we use the tools listed in Table 5-3.\r\n3. Collecting Live Response Data\r\n\r\nTwo key sources of evidence on Windows NT/2000 systems are the event logs (if audit-\r\ning is on) and the Registry on the target system.\r\n\r\nThus, a thorough review of both is required during most investigations. We use the following approach, which obtains quite a bit of information from a live Windows NT/2000 system:\r\n\r\n1. Review the event logs.\r\nObtaining Event Logs during Live Response. Several tools are helpful for obtaining event logs from a live system:\r\n1. auditpol:If Security Policy Changes auditing is turned on, you will find events recorded in the\r\nSecurity log (event ID 612).\r\n2. ntlast : tool that allows you to monitor successful and failed logons to a system, if the systemâ€™s\r\nLogon and Logoff auditing is turned on. You will want to look for suspicious user accounts and remote systems accessing the target system.\r\n\r\nntlast shows successful logons\r\nâ–  ntlast â€“f enumerates failed console logons\r\nâ–  ntlast â€“r lists all successful logons from remote systems\r\nâ–  ntlast â€“f â€“r shows failed remote logons.\r\n\r\n3. dumpel : You will want to retrieve the other logs for offline analysis. Use dumpel and netcat to retrieve remote logs.\r\nâ–  dumpel â€“l security â€“t dumps the entire Security log, with tabs as\r\ndelimiters, to any file you specify.\r\nâ–  dumpel â€“l application â€“t dumps the Application log to standard\r\noutput.\r\n\r\n2. Review the Registry.\r\nThe Windows Registry stores a wealth of important data that is useful during initial response.\r\nFor live retrieval of the important Registry data, you can use\r\nregdump : The regdump utility creates an enormous text file of the\r\nRegistry\r\n reg query : We use reg query instead and extract just the Registry key values of interest.\r\n\r\n3. Obtain system passwords.\r\n\r\nYou may need to get the passwords off the system at the time of response, particularly if\r\nyou have an uncooperative user.\r\npwdump3e, an updated version of Todd Sabinâ€™s pwdump, to dump the passwords from the Security Accounts Manager (SAM) database. These passwords may be cracked on a forensic workstation using John the Ripper, L0phtcrack, or any other Windows password-cracking tool.\r\n\r\n4. Dump system RAM.\r\n1.dump the contents of memory, perhaps to obtain passwords,\r\n2.get the cleartext of a recently typed encrypted message, or\r\n3. retrieve the contents of a recently opened file.\r\nThere are two types of memory that an investigator may wish to obtain:\r\nuser mode (application) memory :You can use the userdump.exe utility, part of the Microsoft OEM Support Tools package, to dump application memory.memory.\r\nfull-system memory: You can use George Garnerâ€™s modified version of the GNU utility dd to dump full-system.\r\n\r\n\r\nIS FORENSIC DUPLICATION NECESSARY?\r\nThe forensic duplication of the target media provides the mirror image of the target system.\r\n1.	This methodology provides due diligence when handling critical incidents.\r\n2.	It also provides a means for having working copies of the target media for analysis without worrying about altering or destroying potential evidence. Generally, if the incident is severe ', 34, '2017-02-24 22:37:40'),
