(48, 23, 'priya@gmail.com', 'Testing for specific goal type', 'completed', 'Subject- Artificail Intelligence				Semester- VII\r\nYear-     2016-17						Class- BE COMPUTER\r\nIssue Date- July 18,2015	                                                Submission Date- August 30,2015\r\n\r\n\r\nObjective\r\n- To learn basic AI concepts by self learning\r\n- To engage and motivate learners\r\n- To use a range of different online courses ,that will allow the student to chose one that suits her.\r\n- To stimulate interest and to help students gain intuition about how artificial intelligence methods work\r\n- To create Excitement About AI Learning in students.\r\n- To provide  opportunities for exploration AI related field\r\n\r\n\r\nSelect any course related to Artificial Intelligence from the following list and complete the course work , homework or assignments given in course outline.\r\n\r\n1) https://www.udacity.com/course/intro-to-artificial-intelligence--cs271\r\n2) http://ocw.mit.edu/courses/electrical-engineering-and-computer-science/6-034-artificial-intelligence-fall-2010/\r\n3) https://www.class-central.com/subject/ai\r\n4) http://web.stanford.edu/class/cs221/\r\n5) https://www.coursera.org/course/aiplan\r\n6) https://www.coursera.org/courses?orderby=upcoming&cats=education&categories=cs-ai\r\n7) http://work.caltech.edu/telecourse\r\n8) https://learn.saylor.org/course/cs405\r\n9) http://www.kdnuggets.com/2011/08/stanford-online-introduction-to-artificial-intelligence-free-course.html\r\n10) https://www.edx.org/course/artificial-intelligence-uc-berkeleyx-cs188-1x#!\r\n\r\n\r\nAfter completion of course , submit the Report on the attended course with following parameters.\r\n\r\nName of the course\r\nObjective of the course\r\nSyllabus of the course\r\nAuthor / Instructor name\r\nDuration \r\nScore of quiz/assignment (if available)\r\nParticipation / completion certificate\r\n\r\n\r\n', 100, '2017-02-25 19:36:42'),
