INSERT INTO `job_master` (`jm_id`, `bm_id`, `gm_id`, `job_desc`, `engg_knowledge`, `prob_analysis`, `development`, `investigation`, `model_tool`, `ethics`, `team_work`, `communication`, `project_mgt`, `learning`, `responsibilities`) VALUES
(1, 1, 1, 'Java Programmer', '<b>Computers and Electronics —</b>\r\nKnowledge of circuit boards, processors, chips, electronic equipment, and computer hardware and software, including applications and programming.<br><br>\r\n<b>English Language —</b> Knowledge of the structure and content of the English language including the meaning and spelling of words, rules of composition, and grammar.<br><br>\r\n<b>Mathematics —</b> Knowledge of arithmetic, algebra, geometry, calculus, statistics, and their applications.<br><br>\r\n<b>Customer and Personal Service —</b> Knowledge of principles and processes for providing customer and personal services. This includes customer needs assessment, meeting quality standards for services, and evaluation of customer satisfaction.<br><br>\r\n<b>Administration and Management —</b> Knowledge of business and management principles involved in strategic planning, resource allocation, human resources modeling, leadership technique, production methods, and coordination of people and resources.', 'Refers to the entire processof taking the statement of a problem and\r\ndeveloping a computer program that solves that problem.', '<b>Making Decisions and Solving Problems —</b> Analyzing information and evaluating results to choose the best solution and solve problems.<br><br>\r\n<b>Getting Information —</b> Observing, receiving, and otherwise obtaining information from all relevant sources.<br><br>\r\n<b>Identifying Objects, Actions, and Events —</b> Identifying information by categorizing, estimating, recognizing differences or similarities, and detecting changes in circumstances or events.\r\n<b>Analyzing Data or Information —</b> Identifying the underlying principles, reasons, or facts of information by breaking down information or data into separate parts.', '<b>Investigative —</b> Investigative occupations frequently involve working with ideas, and require an extensive amount of thinking. These occupations can involve searching for facts and figuring out problems mentally.', '<b>Tools used in this occupation-</b> Computer servers, Desktops, Mainframes.<br><br>\r\n<b>Technology used in this occupation:</b><br>\r\n<b>Compiler and decompiler software —</b> Command interpreters; Just-in-time compiler; Stage compiler; Threaded code compiler.<br><br>\r\n<b>Data base management system software —</b> Microsoft SQL Server; MySQL software; Oracle procedural language/structured query language PL/SQL; Pick software.<br><br>\r\n<b>Data base user interface and query software —</b> dBASE Plus; IEA Software Emerald; Microsoft Access; Structured query language SQL.<br><br>\r\n<b>Development environment software —</b> C; Microsoft Visual Basic; Tier generator software; Xerces2 Java Parser.<br><br>\r\n<b>Object or component oriented development software —</b> C++; Greatis Object Inspector; PowerSoft PowerBuilder; Python.<br><br>\r\n<b>Web platform development software —</b> Hypertext markup language HTML; JavaScript; Microsoft Silverlight; Progress WebSpeed Workshop.<br><br> <b>Programming —</b> Writing computer programs for various purposes.', '<b>Achievement —</b> Occupations that satisfy this work value are results oriented and allow employees to use their strongest abilities, giving them a feeling of accomplishment. Corresponding needs are Ability Utilization and Achievement.', '<b>Dependability —</b> Job requires being reliable, responsible, and dependable, and fulfilling obligations.Independence — Job requires developing one''s own ways of doing things, guiding oneself with little or no supervision, and depending on oneself to get things done.', '<b>Communicating with Supervisors, Peers, or Subordinates —</b> Providing information to supervisors, co-workers, and subordinates by telephone, in written form, e-mail, or in person.', '<b>Updating and Using Relevant Knowledge —</b> Keeping up-to-date technically and applying new knowledge to your job.<br><br><b>Organizing, Planning, and Prioritizing Work —</b> Developing specific goals and plans to prioritize, organize, and accomplish your work.', '<b>Adaptability/Flexibility —</b> Job requires being open to change (positive or negative) and to considerable variety in the workplace.', '1) Correct errors by making appropriate changes and then rechecking the program to ensure that the desired results are produced.<br><br> 2) Conduct trial runs of programs and software applications to be sure they will produce the desired information and that the instructions are correct.<br><br> 3) Compile and write documentation of program development and subsequent revisions, inserting comments in the coded instructions so others can understand the program.<br><br> 4) Write, update, and maintain computer programs or software packages to handle specific jobs, such as tracking inventory, storing or retrieving data, or controlling other equipment.<br><br> 5) Consult with managerial, engineering, and technical personnel to clarify program intent, identify problems, and suggest changes.<br><br> 6) Perform or direct revision, repair, or expansion of existing programs to increase operating efficiency or adapt to new requirements.<br><br>\r\n7) Write, analyze, review, and rewrite programs, using workflow chart and diagram, and applying knowledge of computer capabilities, subject matter, and symbolic logic.<br><br> 8) Write or contribute to instructions or manuals to guide end users.<br><br> 9) Investigate whether networks, workstations, the central processing unit of the system, and/or peripheral equipment are responding to a program''s instructions.<br><br>\r\n10) Prepare detailed workflow charts and diagrams that describe input, output, and logical operation, and convert them into a series of instructions coded in a computer language.<br><br> 11) Perform systems analysis and programming tasks to maintain and control the use of computer systems software as a systems programmer.<br><br> 12) Consult with and assist computer operators or system analysts to define and resolve problems in running computer programs.<br><br> 13) Assign, coordinate, and review work and activities of programming personnel.<br><br> 14) Collaborate with computer manufacturers and other users to develop new programming methods.<br><br> 15) Train subordinates in programming and program coding.'),
(2, 2, 2, 'IT Analyst', 'An Industry Analyst (regardless of industry like IT, Finance, Travel, New Media, or even Autos) conducts research and influences the market by sharing their findings in research reports, direct interaction with buyers/clients, media and press interactions, or from self-publishing using social media technologies.', '', '', '', '', '', '', '', '', '', ''),
(3, 1, 1, 'C Programmer', '<b>Computers and Electronics —</b>\r\nKnowledge of circuit boards, processors, chips, electronic equipment, and computer hardware and software, including applications and programming.<br><br>\r\n<b>English Language —</b> Knowledge of the structure and content of the English language including the meaning and spelling of words, rules of composition, and grammar.<br><br>\r\n<b>Mathematics —</b> Knowledge of arithmetic, algebra, geometry, calculus, statistics, and their applications.<br><br>\r\n<b>Customer and Personal Service —</b> Knowledge of principles and processes for providing customer and personal services. This includes customer needs assessment, meeting quality standards for services, and evaluation of customer satisfaction.<br><br>\r\n<b>Administration and Management —</b> Knowledge of business and management principles involved in strategic planning, resource allocation, human resources modeling, leadership technique, production methods, and coordination of people and resources.', 'Refers to the entire processof taking the statement of a problem and\r\ndeveloping a computer program that solves that problem.', '<b>Making Decisions and Solving Problems —</b> Analyzing information and evaluating results to choose the best solution and solve problems.<br><br>\r\n<b>Getting Information —</b> Observing, receiving, and otherwise obtaining information from all relevant sources.<br><br>\r\n<b>Identifying Objects, Actions, and Events —</b> Identifying information by categorizing, estimating, recognizing differences or similarities, and detecting changes in circumstances or events.\r\n<b>Analyzing Data or Information —</b> Identifying the underlying principles, reasons, or facts of information by breaking down information or data into separate parts.', '<b>Investigative —</b> Investigative occupations frequently involve working with ideas, and require an extensive amount of thinking. These occupations can involve searching for facts and figuring out problems mentally.', '<b>Tools used in this occupation-</b> Computer servers, Desktops, Mainframes.<br><br>\r\n<b>Technology used in this occupation:</b><br>\r\n<b>Compiler and decompiler software —</b> Command interpreters; Just-in-time compiler; Stage compiler; Threaded code compiler.<br><br>\r\n<b>Data base management system software —</b> Microsoft SQL Server; MySQL software; Oracle procedural language/structured query language PL/SQL; Pick software.<br><br>\r\n<b>Data base user interface and query software —</b> dBASE Plus; IEA Software Emerald; Microsoft Access; Structured query language SQL.<br><br>\r\n<b>Development environment software —</b> C; Microsoft Visual Basic; Tier generator software; Xerces2 Java Parser.<br><br>\r\n<b>Object or component oriented development software —</b> C++; Greatis Object Inspector; PowerSoft PowerBuilder; Python.<br><br>\r\n<b>Web platform development software —</b> Hypertext markup language HTML; JavaScript; Microsoft Silverlight; Progress WebSpeed Workshop.<br><br> <b>Programming —</b> Writing computer programs for various purposes.', '<b>Achievement —</b> Occupations that satisfy this work value are results oriented and allow employees to use their strongest abilities, giving them a feeling of accomplishment. Corresponding needs are Ability Utilization and Achievement.', '<b>Dependability —</b> Job requires being reliable, responsible, and dependable, and fulfilling obligations.Independence — Job requires developing one''s own ways of doing things, guiding oneself with little or no supervision, and depending on oneself to get things done.', '<b>Communicating with Supervisors, Peers, or Subordinates —</b> Providing information to supervisors, co-workers, and subordinates by telephone, in written form, e-mail, or in person.', '<b>Updating and Using Relevant Knowledge —</b> Keeping up-to-date technically and applying new knowledge to your job.<br><br><b>Organizing, Planning, and Prioritizing Work —</b> Developing specific goals and plans to prioritize, organize, and accomplish your work.', '<b>Adaptability/Flexibility —</b> Job requires being open to change (positive or negative) and to considerable variety in the workplace.', '1) Correct errors by making appropriate changes and then rechecking the program to ensure that the desired results are produced.<br><br> 2) Conduct trial runs of programs and software applications to be sure they will produce the desired information and that the instructions are correct.<br><br> 3) Compile and write documentation of program development and subsequent revisions, inserting comments in the coded instructions so others can understand the program.<br><br> 4) Write, update, and maintain computer programs or software packages to handle specific jobs, such as tracking inventory, storing or retrieving data, or controlling other equipment.<br><br> 5) Consult with managerial, engineering, and technical personnel to clarify program intent, identify problems, and suggest changes.<br><br> 6) Perform or direct revision, repair, or expansion of existing programs to increase operating efficiency or adapt to new requirements.<br><br>\r\n7) Write, analyze, review, and rewrite programs, using workflow chart and diagram, and applying knowledge of computer capabilities, subject matter, and symbolic logic.<br><br> 8) Write or contribute to instructions or manuals to guide end users.<br><br> 9) Investigate whether networks, workstations, the central processing unit of the system, and/or peripheral equipment are responding to a program''s instructions.<br><br>\r\n10) Prepare detailed workflow charts and diagrams that describe input, output, and logical operation, and convert them into a series of instructions coded in a computer language.<br><br> 11) Perform systems analysis and programming tasks to maintain and control the use of computer systems software as a systems programmer.<br><br> 12) Consult with and assist computer operators or system analysts to define and resolve problems in running computer programs.<br><br> 13) Assign, coordinate, and review work and activities of programming personnel.<br><br> 14) Collaborate with computer manufacturers and other users to develop new programming methods.<br><br> 15) Train subordinates in programming and program coding.'),
(4, 2, 3, 'Web Developer', '<b>Computers and Electronics —</b> Knowledge of circuit boards, processors, chips, electronic equipment, and computer hardware and software, including applications and programming.<br><br><b>English Language —</b> Knowledge of the structure and content of the English language including the meaning and spelling of words, rules of composition, and grammar.<br><br> <b>Mathematics —</b> Knowledge of arithmetic, algebra, geometry, calculus, statistics, and their applications.<br><br>\r\n<b>Customer and Personal Service —</b> Knowledge of principles and processes for providing customer and personal services. This includes customer needs assessment, meeting quality standards for services, and evaluation of customer satisfaction.<br><br>\r\n<b>Administration and Management —</b> Knowledge of business and management principles involved in strategic planning, resource allocation, human resources modeling, leadership technique, production methods, and coordination of people and resources.', '<b>Operations Analysis —</b> Analyzing needs and product requirements to create a design.<br><br><b>Active Listening —</b> Giving full attention to what other people are saying, taking time to understand the points being made, asking questions as appropriate, and not interrupting at inappropriate times.', '<b>Design —</b> Knowledge of design techniques, tools, and principles involved in production of precision technical plans, blueprints, drawings, and models.', '<b>Complex Problem Solving —</b> Identifying complex problems and reviewing related information to develop and evaluate options and implement solutions.', '<b>High capacity removable media drives —</b> Universal serial bus USB flash drives.<br><br>\r\n<b>Notebook computers —</b> Laptop computers,Personal computers.<br><br>\r\n<b>Technology used in this occupation:</b><br>\r\n<b>Application server software —</b> JBoss Application Server; Oracle Application Server.<br><br>\r\n<b>Development environment software —</b> Android, C; Microsoft Visual Basic; Subversion.<br><br>\r\n<b>Graphics or photo imaging software —</b> Adobe Systems Adobe After Effects; Adobe Systems Adobe Fireworks; Adobe Systems Adobe Illustrator; Adobe Systems Adobe Photoshop software.<br><br>\r\n<b>Object or component oriented development software —</b> Apple Cocoa; C++; Microsoft ActiveX; Python.<br><br>\r\n<b>Web platform development software —</b> Hypertext markup language HTML; JavaScript; Microsoft Commerce Server; Ruby on Rails.', '<b>Independence —</b> Occupations that satisfy this work value allow employees to work on their own and make decisions. Corresponding needs are Creativity, Responsibility and Autonomy.<br><br><b>Working Conditions —</b> Occupations that satisfy this work value offer job security and good working conditions. Corresponding needs are Activity, Compensation, Independence, Security, Variety and Working Conditions.<br><br><b>Achievement —</b> Occupations that satisfy this work value are results oriented and allow employees to use their strongest abilities, giving them a feeling of accomplishment. Corresponding needs are Ability Utilization and Achievement.', '<b>Cooperation —</b> Job requires being pleasant with others on the job and displaying a good-natured, cooperative attitude.', '<b>Communicating with Supervisors, Peers, or Subordinates —</b> Providing information to supervisors, co-workers, and subordinates by telephone, in written form, e-mail, or in person.', '<b>Updating and Using Relevant Knowledge —</b> Keeping up-to-date technically and applying new knowledge to your job.<br><br><b>Organizing, Planning, and Prioritizing Work —</b> Developing specific goals and plans to prioritize, organize, and accomplish your work.', 'Highly flexible and updation needed regularly with upcoming technologies.', '1) Set up technical server infrastructure, providing technical assistance to development teams, monitoring site performance, and troubleshooting issues when they arise.<br><br>\r\n2) Work with Director of Web Services to set up a development server environment and a live server environment with aprocess for testing and deploying changes to live site.<br><br>\r\n3) Take an active role in designing, implementing and maintaining a scalable and robust enterprise server environment.<br><br>\r\n4) Administer Apache web server and MySQL Server.<br><br>\r\n5) Work on System Security and IPTable configuration.<br><br>\r\n6) Linux system updates and software installation (yum, apt-?get, etc.).<br><br>\r\n7) Optimize servers for high traffic, security, and other related system issues.<br><br>\r\n8) Evaluate and propose new or improved system architecture.<br><br>\r\n9) Document system configuration, processes, and procedures.<br><br>\r\n10) Share responsibility with team members for rotating on?call duties.<br><br>\r\n11) Other duties as assigned.'),
(8, 1, 4, 'Business Development Officer', 'Front line sales operative of the organization in assigned area.  Assignment of a Particular branch and generate sales from that particular area and catchment area Responsible for generating business and leads through outbound sales activities and tie ups with potential POS. Responsible to ensure that assigned branch will be not the weak and loss making category, and would co ordinate with the marketing department for business promotional activities for improvement of these branches. Responsible to source the business from that particular area Daily reporting to branch Head Sourcing the business direct from the market by cold calling ', 'Communication Skills, Basic product knowledge (could be about any financial service or financial product), should be able to identify potential customers, convincing skills  ', '', '', '', '', '', '', '', '', ' '),
(9, 1, 4, 'Equity Advisor', 'Keeping abreast of market changes and analysing stock movements/ finance of the company Updating clients on research calls and advising them on asset allocation within their portfolio Ensuring adherence to compliance norms of the organization Should be working on primary markets. Advisory should happen either voice based, Chat based, Email based or inbound calls', 'Should have excellent communication skills, Should be strong at basics of financial management Should have interest on capital markets and research Candidates with NCFM or CFA or MFA will have hiring preference. Basic excel knowledge is must.  ', '', '', '', '', '', '', '', '', ' '),
(10, 1, 4, 'Personal Financial Executive', 'Prospecting of customers from Open Market.  Good understanding of Financial products and presentation of those to customers Excellent customer relationship management ', 'Communication Skills, Awareness of Products like Mutual Funds, Fixed Deposits, Insurance, Bonds, Debentures & IPOs   ', '', '', '', '', '', '', '', '', ' '),
(11, 1, 4, 'Business Analyst', 'Proficient in gathering & enumerating clear, coherent and concise requirements.  Experience with BFSI will be preferred Ability to work in a cross-functional environment and deliver effectively in a team Knowledge on Product management, Market analysis, Sales forecasting, Trend analysis, Arbitrage, After-sales services, Pricing, JIT (Just in Time), etc. concepts will be a plus Technical knowledge that can help can suggest a solution will be an added advantage Experience gathering requirements for mobile applications / solutions will be preferred', 'Smart, customer savvy & willing for frequent travel. Strong analytical and excellent communication skills with an ability to transform the needs of stakeholders into Technical requirements. Good presentation and training/documentation skills  ', '', '', '', '', '', '', '', '', ' '),
(12, 1, 4, 'Credit Support Officer', 'Financial Analysis and Risk analysis. Assessment of the proposals received from RM / Branch and put up the same to the designated authorities for approval. Scrutiny of Statements received from the Branch / RM. Seeking clarifications at the earliest and liaison with sanctioning authorities. Ensure the disposal of sanctioned loan. Monitoring the portfolio through LPS, reviews. Liaison Officer with regard to the branches allocated and ensures the Health and Growth of SME Portfolio. Monitoring / coordinating with branch for Review / Renewal, NPA  accounts, Regularisation of Adhoc / Excess Advances. Complying with all RBI Regulations and helping the branches in rectification of Inspections / submitting the replies etc.', 'Basic knowledge of Banking, risk management and financial products and services provided by banks Good communication skills Compliance and documentation  ', '', '', '', '', '', '', '', '', ''),
(13, 1, 4, 'Research and Data Analyst', 'Data Handling  a.	Data Audit Check data quality, identify gaps and create summary as per database requirements b.	Data Profiling Create multi-dimensional data views, data analysis, reports and extracts  Data Classification  a.	Data Classification Analyze procurement spend & identify saving opportunities using the analytics tool/spend data audit reports b.	Create and update category-specific and opportunity spend-assessment reports/templates  Industry Research  a.	Conduct market research to create company, industry primers, etc. using online secondary data or information sources', '1.	Excellent analytical and research capabilities comfort and proficiency in handling large data analysis and secondary market research 2.	Good spoken and written (English) communication skills - should be able to participate in global team calls 3.	Advanced MS Excel skills ability to handle and structure analysis independently 4.	Good working knowledge of MS PowerPoint and MS Word, experience with creating presentations 5.	Excellent attention to details, high output accuracy and out-of-box thinking to bring in innovative approaches to problems/issues in data processing   ', '', '', '', '', '', '', '', '', ' '),
(14, 1, 4, 'Junior Research Analyst', ' Preparation of worksheets, industry comparisons, company profiles and business analysis. Involvement in various assignments for research documentation, financial analysis, report writing etc. Will be required to use databases, select and analyse companies. Should have basic familiarity with financial statements of companies, should be able to take fundamental analysis.', 'Proficient in the use of computer and analytical softwares. Should be self motivated, hard working and enthusiastic. Methodical and analytical in their approach towards work. Good financial and analytical skills and should be very proficient with computers He/She should be able to work with a team.  ', '', '', '', '', '', '', '', '', ' '),
(15, 1, 4, 'Management Trainee', 'On the Job Training in all the functional areas of management Like Client representative, talent acquisition, financial assistant, business head etc.', 'Basic knowledge of financial concepts, good communication and presentation skills, open to learning and training  ', '', '', '', '', '', '', '', '', ''),
(16, 1, 4, 'Relationship Manager – Stock B', 'Responsible for generating revenue & maximizing the brokerage for the department by meeting the targets of account opening operations To accomplish Account opening targets, set by the superiors.  Accomplishing the brokerage targets; C to C (Cost to Costing).  Generating leads through cold calling. Analyzing & increasing the client database and finding out the potential  Acquiring more and more Clients with high net worth for getting increased revenues.', 'Basic knowledge of equity, commodity, currency, broking,  share capital securities, shares trading, fixed income brokerage lead generation,  cold calling,  cross selling,  revenue generation,  relationship management,  Direct marketing  ', '', '', '', '', '', '', '', '', ' '),
(17, 1, 4, 'Executive Trainee – Accounts a', 'Supporting higher levels of management in functional areas such as Accounts, Finance, Tax, Company Secretary, Audit', 'Understanding of financial statements/Cost audit reports. Good Communication & Team player. Strong analytical and interpretive skills.  ', '', '', '', '', '', '', '', '', ' '),
(18, 1, 4, 'Bank – Back Office Operations ', 'Generate financial ratios, using computer programs, to evaluate financial status.  Evaluate customer records and recommend payment plans based on earnings, savings data, payment history, and purchase activity.  Work on MIS for generate Customers Data', 'Basic knowledge in Banking, Aware about the Banking Sector Handling Client/Customer queries. Report and MIS. Reconciliation & Customer accounts Making For Customers Clearing Update Should have knowledge of some financial terms Cross Selling Good Communication Skills.  ', '', '', '', '', '', '', '', '', ''),
(19, 1, 4, 'Probationary Officer – PSU Ban', 'Open to learning all the functional areas in banking like assets, liabilities, credit, operations etc', 'Basic knowledge in Banking, Aware about the Banking Sector Cross Selling Good Communication Skills.  Should have appeared and cleared the IBPS Examination  ', '', '', '', '', '', '', '', '', ''),
(20, 1, 4, 'Bank Executives – Retail Banki', 'To maintain bank’s relationship with all existing & new customers To understand and cater to the needs of wealthy clients Monitor and manage existing credit relationships Develop new business by identifying and contacting existing or prospective customers and promote the bank services Cater to a wide variety of commercial and individual loans, both secured and unsecured May also have to deal with the delivery of brokerage, investment management, trust and insurance products and services', 'Basic knowledge in Banking, Aware about the Banking Sector Handling Client/Customer queries. Should have knowledge of some financial terms Cross Selling Good Communication Skills.  ', '', '', '', '', '', '', '', '', ' '),
(21, 1, 4, 'Loan Officer', 'Check loan agreements to ensure that they are complete and accurate, according to policies. Refer loans to loan committees for approval. Approve loans within specified limits. Submit applications to credit analysts for verification and recommendation. Analyze applicants'' financial status, credit, and property evaluations to determine feasibility of granting loans. Interview applicants and request specified information for loan applications. Establish payment priorities according to credit terms and interest rates to reduce clients'' overall costs. Contact applicants or creditors to resolve questions about applications or to assist with completion of paperwork. Maintain current knowledge of credit regulations.', 'Compliance with documents,  Follow up,  Credit Appraisal,  Basic knowledge on loans and risk management  ', '', '', '', '', '', '', '', '', ''),
(22, 1, 4, 'Treasury Manager', 'Market treasury solutions to Corporate Clients Provide hedging solutions on FX and Interest Rates to clients Establish, maintain and manage relationships with customers with Forex/IR exposures Tap maximum potential from existing customers and target segments Develop target segments and customers, internal as well as external to the Bank Be aware about the markets / customers / regulations / products Keeping the client updated on the Forex market movements. Information to clients on changes in regulatory policies. Adhering to Sales processes, (To have completed MIS on customers). Meet existing as well as target clients on an on-going basis Keeping abreast with all regulations / internal guidelines Maintain timeliness on all activities defined Obtain knowledge about exchange control regulations pertaining to Forex Working on Incident Resolution, Problem identification/resolution and to work on changes (as per the Change Manager instructions) Solving incidents as per SLA and customer satisfaction Solving production requests Root cause analysis where it is required Working on changes as agreed with change proposal Delivering good service by giving good solutions within predefined amount of time', 'Knowledge of forex markets Compliance with documents,  Follow up,  Basic knowledge on risk management  ', '', '', '', '', '', '', '', '', ''),
(23, 1, 4, 'Research Assistant', 'Mass mailing/Bulk emailing about the services to potential clients. Data searching on internet via Google Generating leads for business development through e-mail campaigns Excellent communication skills (both verbal and written) Expert in MS office Email drafting and marketing Social media skills Experience using email marketing tools such as constantcontact, icontact, mailchimp, Infusionsoft, etc. Knowledge in Word press is a plus', 'Employee must work full time from our offices Quick and enthusiastic learner Team member who can work harmoniously with others Hardworking and honest in performing any duties assigned  ', '', '', '', '', '', '', '', '', ''),
(24, 1, 4, 'Research Associate', 'To create value added content by utilizing internal & external public research sources such as government & regulatory documents, stock exchanges, industry journals, analyst reports as well as information databases and our research tools to collect, summarize, and synthesize relevant financial, industry-specific market, and business information pertaining to: Global Public and Private companiesCritical Business Information Financial News Transactions such as Mergers & Acquisitions, Private Placements, and Public Offering Transactions Key Executives and Directors', 'Domain Knowledge: Familiarity with the global Business environment, Databases, international/ global Research sources and Content. Ability to work in fast paced environment on multiple tasks simultaneously and also as part of team but still be able to function independently. Ability to prioritize, multi-task, and deliver with regard to fast deadlines. An inquisitive and investigative nature.  ', '', '', '', '', '', '', '', '', ' '),
(25, 1, 4, 'Accounting/Finance Executive', 'Vendor Accounting (Including Fixed assets accounting) & Employee Accounting Able to interact with the other service line & function Any other task to meet the job requirement', 'MS Office, specially excel Knowledge of accounting packages Good Communication skills  ', '', '', '', '', '', '', '', '', ''),
(26, 1, 4, 'Actuarial Assistant Manager', 'Assist in performing ad-hoc and periodic portfolio level analysis  Industry benchmarking across various parameters like profitability, market share, growth, etc. Undertake various data gathering, analyze documentation, carry out risk based capital modeling exercise for reserving and pricing. Data collection, cleansing and validation till a final database is created and its subsequent analysis Automation of processes using different software like Cognos, SAS, etc. Analyzing and monitoring the performance and pricing dynamics across the spectrum of products. Generate daily MIS and monthly IRDA reports using Cognos. Assist in Financial Condition Reporting to IRDA on an annual basis.', 'MS Office, specially excel Data Collection and analysis Analytical Skills Awareness about various softwares Good Communication skills  ', '', '', '', '', '', '', '', '', ''),
(27, 1, 4, 'Risk Management Executive', 'Confirming the customer selection process including Proposal Rating and Underwriting of business as per company norms Analysing the portfolio and suggesting corrective actions in sourcing and underwriting Managing the team of Field Executives / Collection Agents Monitoring First Cheque Presentation and clearance Analyse Cheque Bounce and take corrective action to reduce cheque bounce trends Monitoring the Cheque Bounce collection Monitoring Early Delinquencies and analysing the root cause  Managing Repossessions', 'Should have sound conceptual knowledge on Mathematics (simulation, regression, time series) Basic knowledge about risk and risk management techniques Team Player Analytical Skills ', '', '', '', '', '', '', '', '', '');
