(2, 24, 'In mathematics and computer programming, which is the correct order of mathematical operators ?', 'Addition, Subtraction, Multiplication, Division', 'Division, Multiplication, Addition, Subtraction', 'Multiplication, Addition, Division, Subtraction', 'Addition, Division, Modulus, Subtraction Answer & Explanation Answer: Option B  Explanation:  Simply called as BODMAS (Brackets, Order, Division, Multiplication, Addition and Subtraction).  Mnemonics are often used to help students remember the rules, but the rules taught by the use of acronyms can be misleading. In the United States the acronym PEMDAS is common. It stands for Parentheses, Exponents, Multiplication, Division, Addition, Subtraction. In other English speaking countries, Parentheses may be called Brackets, or symbols of inclusion and Exponentiation may be called either Indices, Powers or Orders, and since multiplication and division are of equal precedence, M and D are often interchanged, leading to such acronyms as BEDMAS, BIDMAS, BODMAS, BERDMAS, PERDMAS, and BPODMAS.  For more info: http://en.wikipedia.org/wiki/Order_of_operations', 3, '', ''),
