(61, 1, 'Two friends A and B run around a circular track of length 510 metres, starting from the same point, simultaneously and in the same direction. A who runs faster laps B  in the middle of the 5th 5th  round. If A  and B were to run a 3 km race long race, how much start, in terms of distance, should A give B so that they finish the race in a dead heat?  ', '545.45 metres', '  666.67 metres  ', '857.14 metres', 'Cannot be determined', 2, '', ''),
(61, 2, 'Yana and Gupta leave points x and y towards y and x respectively simultaneously and travel in the same route. After meeting each other on the way, Yana takes 4 hours to reach her destination, while Gupta takes 9 hours to reach his destination. If the speed of Yana is 48 km/hr, what is the speed of Gupta?  ', '72 kmph', ' 39 mph  ', '32 kmph', 'None of these', 3, '', ''),
(61, 3, 'Twenty six men - 1,2,3,....25 and 26 participate in 10km running race on a circular track of length 100m. All of them start at the same time, from the same point and run in the same direction. Their speeds, taken in the order, are in increasing AP AP . The time taken by 26 to meet 1, for the first time after they start is 20 sec and the time taken by 13 to complete the race is 52 minutes and 5 seconds. Find the time taken (in seconds), for all the twenty six men to meet for the first time at the starting point.', '1000', '500', '625', '400  ', 2, '', ''),
(61, 4, 'A man driving his bike at 24 kmph reaches his office 5 minutes late. Had he driven 25 25  faster on an average he would have reached 4 minutes earlier than the scheduled time. How far is his office? ', '24 km', '72 km', '18 km', 'Data Insufficient  ', 3, '', ''),
(61, 5, 'Two motorists Anil and Sunil are practicing with two different sports car; Ferrari and Maclarun, on the circular racing track, for the car racing tournament to be held next month. Both Anil and Sunil start from the same point on the circular track. Anil completes one round of the track in 1 min and Sunil takes 2 min to complete a round. While Anil maintains speed for all the rounds, Sunil halves his speed after the completion of each round. How many times Anil and Sunil will meet between 6th round and 9th round of Sunil (6th and 9th round is excluded)? Assume that the speed of Sunil remains steady throughout each round and changes only after the completion of that round.', '382', '347', '260', 'None of these  ', 1, '', ''),
(61, 6, 'The XYZ  river flows at 12 km/hr. A boy who can row at 2518 m/s in still water had to cross it in the least possible time. The distance covered by the boy is how many times the width of the river XYZ ?', '2.1', '2.3', '2.6', '2.9', 3, '', ''),
(61, 7, 'In a 3600 m race around a circular track of length 400m, the faster runner and the slowest runner meet at the end of the fourth minute, for the first time after the start of the race. All the runners maintain uniform speed throughout the race. If the faster runner runs at thrice the speed of the slowest runner. Find the time taken by the faster runner to finish the race.', ' 36 minute', '24 minute', '16 minute ', '12 minute  ', 2, '', ''),
(61, 8, 'In an industry, the raw materials and the finished goods are transported on the conveyor belt. There are two conveyor belt, one for carrying parts from P P  to point Q Q  and another for carrying parts from R R  to point Q Q . P P , Q Q  and R R  in that order are in a straight line. Sometimes, the belt serves to transport cart, which can themselves move with respect to the belts. The two belts move at a speed of 0.5 m/s and the cart move at a uniform speed of 2 m/s with respect to the belts. A cart goes from point P P  to R R  and back to P P  taking a total of 64 s. Find the distance PR PR  in meters. Assume that the time taken by the cart to turn back at R R  is negligible? ', '48', '54', '60', '64', 3, '', ''),
(61, 9, 'P and Q  travels from D to A and break journey at M in between. Somewhere between D and M, P asks "how far have we travelled?" Q replies, "Half as far as the distance from here to M". Somewhere between M and A, exactly 300 km from the point where P asks the first question, "How far have we to go?" Q replies, "Half as far as the distance from M to here". The distance between D and A is:  ', ' 250 km ', '350 km', '450 km', '500 km', 3, '', ''),
(61, 10, 'From a point P  , on the surface of radius 3 cm, two cockroaches  A  and  B  started moving along two different circular paths, each having the maximum possible radius, on the surface of the sphere, that lie in the two different planes which are inclined at an angle of 45 degree to each other. If A   and B   takes 18 sec and 6 sec respectively, to complete one revolution along their respective circular paths, then after how much time will they meet again, after they start from P ?', ' 27 sec ', ' 24 sec', ' 18 sec', ' 9 sec ', 4, '', ''),
(61, 11, 'A , B  and C start simultaneously from X to Y . A  reaches Y, turns back and meet B at a distance of 11 km from Y. B  reached Y, turns back and meet C  at a distance of 9 km from Y. If the ratio of the speeds of A and C is 3:2 , what is the distance between X and Y ?', '  99 m', '100 m ', '120 m ', '142 m     ', 1, '', ''),
(61, 12, 'Laila drives to the station each day to pick up her husband Majnu, who usually arrives on a train at 6 o’clock. Last Monday, Majnu finished work earlier, caught an earlier train and arrived at the station at 5 ‘o clock. He started to walk home and eventually met Laila who drove him the rest of the way, getting home 20 minutes earlier than usual. On Tuesday, he again finished early and found himself at the station at 5:30. Again he began to walk home, again he met Laila on the way, and she drove him home the rest of the way, Assume constant speed throughout with no wasted time for waiting, backing of the car etc. How earlier than the usual time were they home on Tuesday?  ', ' 6 min', '8 min', '10 min', '12 min', 3, '', ''),
(61, 13, 'Three athletes A, B  and C  run a race,  B  finished 24 meters ahead of C and 36 m ahead of A , while C finished 16 m ahead of A . If each athlete runs the entire distance at their respective constant speeds, what is the length of the race? ', '108 m', '90 m', ' 80 m', '96 m', 4, '', ''),
(61, 14, 'Mukesh, Suresh and Dinesh travel from Delhi to Mathura to attend Janmashtmi Utsav. They have a bike which can carry only two riders at a time as per traffic rules. Bike can be driven only by Mukesh. Mathura is 300 km from Delhi.  All of them walk at 15 km/h. All of them start their journey from Delhi simultaneously and are required to reach Mathura at the same time.  If the speed of bike is 60km/h, then what is the shortest possible time in which all three can reach Mathura at the same time? ', '58/7   hr   ', '65/7 hr', '10 10  hr', 'None of these', 2, '', ''),
(61, 15, 'A 20 litre mixture of milk and water contains milk and water in the ratio 3 : 2. 10 litres of the mixture is removed and replaced with pure milk and the operation is repeated once more.  At the end of the two removals and replacement, what is the ratio of milk and water in the resultant mixture?  ', '17 : 3  ', '9 : 1 ', '3 : 17  ', '5 : 3    ', 2, '', ''),
(61, 16, 'How many kgs of Basmati rice costing Rs.42/kg should a shopkeeper mix with 25 kgs of ordinary rice costing Rs.24 per kg so that he makes a profit of 25% on selling the mixture at Rs.40/kg?', '20.0 kgs ', '12.5 kgs', '16.0 kgs', '200.0 kgs', 1, '', ''),
(61, 17, 'In what ratio must a person mix three kinds of wheat costing him Rs 1.20,Rs 1.44 and Rs 1.74 per Kg so that the mixture may be worth Rs 1.41 per Kg?', '11 : 77 : 7', '25 : 45 : 8', '27 : 23 : 6  ', '11 : 45 : 7 ', 1, '', ''),
(61, 18, 'How many litres of water should be added to a 30 litre mixture of milk and water containing milk and water in the ratio of 7 : 3 such that the resultant mixture has 40% water in it? ', '5 litres ', '7 litres', '10 litres   ', 'None of these ', 1, '', ''),
(61, 19, 'A sample of x x  litres from a container having a 60 litre mixture of milk and water containing milk and water in the ratio of 2 : 3 is replaced with pure milk so that the container will have milk and water in equal proportions. What is the value of x ?', '6 litres', '10 litres', '30 litres', 'None of these', 2, '', ''),
(61, 20, 'From a cask of milk containing 30 litres, 6 litres are drawn out and the cask is filled up with water.  If the same process is repeated a second, then a third time, what will be the number of litres of milk left in the cask?', ' 5.12 litres ', '12 litres', '14.38 litres', '15.36 litres', 4, '', ''),
(61, 21, 'A zookeeper counted the heads of the animals in a zoo and found it to be 80. When he counted the legs of the animals he found it to be 260.  If the zoo had either pigeons or horses, how many horses were there in the zoo?', '30', '40', '50', '60', 3, '', ''),
(61, 22, 'How many litres of a 12 litre mixture containing milk and water in the ratio of 2 : 3 be replaced with pure milk so that the resultant mixture contains milk and water in equal proportion?', '1.0 litres', '1.5 litres', '2.0 litres', '4.0 litres', 3, '', ''),
(61, 23, 'A merchant mixes three varieties of rice costing Rs.20/kg, Rs.24/kg and Rs.30/kg and sells the mixture at a profit of 20% at Rs.30 / kg.  How many kgs of the second variety will be in the mixture if 2 kgs of the third variety is there in the mixture?', '1 kg', '3 kg', '5 kg', '6 kg', 3, '', ''),
