(26, 28, 'Study the following information and answer the questions given below:\r\n•	There are two married couple in the family of six people (U, V, W, X, Y, Z)\r\n•	W is wife of V and mother of Z.\r\n•	X is grandmother of U and mother of V.\r\n•	Z is grand-daughter of Y.\r\n'),
(26, 29, 'i) A and B play Football and Hockey<br>\r\nii) C and D play Badminton and Cricket<br>\r\niii)B and C play Cricket and Football<br>\r\niv)A and D plays Badminton, Football and Hockey\r\n'),
(27, 30, 'If the first three letters of the ‘C O M P R E H E N S I O N’ are reversed, then last three letters are added and then the remaining letters are reversed and added, then:'),
(27, 31, 'If first six letters of the word ‘T H O U G H T F U L E S S N E S S’ are reversed, next six letters are written as they are and then the remaining letters are reversed,then:'),
(27, 32, 'If the first four letters of a foreign term ‘H I P P N O W A D I A S M’ are written in reverse order, next five letters are written without changing their order and then the remaining letters are again written in reverse order, then:'),
(27, 33, 'The following sequence of letters:\r\nm n m n n m m n m n m m m u u m n m n n m m m n \r\n'),
(27, 34, 'Following sequence of numbers:\r\n8 9 6 7 3 9 3 7 8 3 9 9 5 6 3 9 6 6 9 3 9 8\r\n'),
(28, 36, 'Read the following passage and answer the questions below:<br>\r\nMr. Summit Bali was a heading a medium-size soft drink manufacturing company, M/s AC Food & Beverage (ACFB). Three popular brands of his company has captured a sizable share in the soft drinks segment of processed foods and beverages market in India. However, as there were several other brands of aerated water already in the company, Mr. Bali wanted to diversify in other areas of food manufacturing before the growth of his present operations become stagnant.<br>\r\n	Mr. Morris Jackson, the representative of M/s General Foods Limited (GFL), a multi-national US-based food processing company, was to visit India to offer transfer of technology for manufacturing of processed foods. Mr. Bali wanted to negotiate with Mr. Jackson the terms and conditions for getting the technology for his company to negotiate is like a game of chess, which requires one to anticipate the moves of one’s rival in advance, build one’s strategies on it and then be prepared to respond effectively if initial assumptions are wrong. This involves several factors, which includes the charisma of the negotiator’s personality, his persuasive power and his understanding of the background.<br>\r\n	Mr. Bali had to prove to Mr. Jackson, why his company (ACFB) was a better choice of Mr. Jackson to enter into the deal for transfer of technology, than any other company in India. ACFB had an impressive track record (around 20 per cent growth per annum) and had a strong Research and Development base of its own. However, it was nothing in size compared to other giants in the field. Mr. Bali also had the information that atleast three such companies, with sound financial background, were in the fray for this negotiation. What should Mr. Bali be willing to give to Mr. Jackson? The issue of transfer of technology was linked to the terms and conditions of payment of royalty to made to GFL for this deal. What should be the price? What objectives should Mr. Bali set for himself? <br>\r\n	The technology being offered by Mr. Jackson was a new technology of food processing, which is not yet available in India, had already revolutionized the western food industry. Any price which Mr. Bali offers would be linked to the estimate of profits that is envisage of profits that is envisaged from this new venture. He has also to ensure that the profits being generated by his three leading soft drinks brands, was not to be taken into account. Mr. Bali had to decide what potential could be realized from this new technology and what kind of stimulus his R & D base would get from this new technology to exploit it further to develop still better indigenous technology with the passage of time.<br>\r\n	Mr. Bali had to work on the estimate of the amount of royalty Mr. Jackson expected for this technology this estimate would be linked to Mr. Jackson’s perception of the growth which could be realized by application of the new technology. This would also depend on the motives of Mr. Jackson behind his willingness to transfer the technology developed by GFL, were the other factors at work, such as, developed a better technology and could revolutionize the food processing industry in the US. Another important factor was to anticipate what Mr. Jackson had in mind. A lump-sum one-time payment or two three annual installments? Maybe, Mr. Jackson was willing to accept a small one-time payment and a share in the long term profitability of the technology in India. Mr. Bali had also to consider whether Mr. Jackson knew what offers the tree competitors in the fray had to make. Mr. Jackson wanted an entry in the Indian market to survey what kind of needs existed in the Indian market for processed foods? Whether he was looking to take advantage of India’s liberal economic policies of the government and be able to promote his other products and technologies in the Indian market and was Mr. Jackson looking to compete with those multi-national companies by giving Mr. Bali the offer for one particular technology and then come in India with other brands? Much depends on the personal bias, value system and preferences of Mr. Jackson. How depends Mr. Bali deal with him? Mr. Bali knew that striking a deal with Mr. Jackson was of considerable importance for the long term survival of ACFB. A long term association with Mr. Jackson was rewarding for ACFB’s growth in future. Should he be frank, candid and forthright? Should be highlight only his strongest points? Should he pay smart with Mr. Jackson and win the deal?\r\n	Mr. Bali had been working but things were not to his full satisfaction. The data of negotiation had come next morning and Mr. Bali was not yet clear on all the issues. However, he was confident that his brain would become razor sharp once he sat before Mr. Jackson and would be able to take instant decisions because earlier also, he had executed such negotiations with success. He had experienced that many of the decisions in such situations he had taken, came out of momentary, brilliant and intuitive insight not yet sure, he was confident of sorting them out once the round of negotiations begin. He knew he would be able to influence Mr. Jackson and strike the deal comfortably. \r\n'),
(28, 37, 'A company ‘Y’ is engaged in the manufacture and selling of instant breakfast foods. It has a long standing in the consumer market and has captured a good market share in instant packed goods. As the company enjoys a long standing, and is quality oriented, it has over the years increased its overhead expenses substantially. However, as it has a good market share, it is surviving with good monetary results. The factory is situated in Jagraonbad which is very far away from the main consumer market, which is the country’s capital., and other bigger towns in the vicinity. This distance from the main consumer market further attributed to higher cost of the product being marketed by company ‘Y’.<br>\r\n	Another company ‘X’ came up a few years back, with its factory situated near Ambalpur, a few km from the main capital town and other bigger towns in the area. The product being manufactured by this company was more or less same in taste, flavor, etc. as that of company ‘Y’. In view of its proximity with the consumer cities, the transportation cost being incurred by company ‘X’ is comparatively less. Furthermore, being a new enterprise, it has controlled overhead expenses. With this advantage to their credit, they priced their product little less than that of company ‘Y’, they slowly penetrated into the market share of company ‘Y’ and in a short span of time took a good slice from company ‘Y’s’ business.<br>\r\n	The company ‘Y’ is now faced with the problem of competing with this new company ‘X’ without, of course degrading the quality of the product. Company ‘Y’ in the market and it will also reduce the price of their product as it lowers the image of the company in the market and it will also reduce their profit, which in the present set up of the company, they cannot afford to do. The chief executive of the company is now faced with the problem of competing with company ‘X’ without lowering market reputation of his company and influencing profits.<br>\r\n	The chief executive decided to undertake a detailed market survey and study all types of instant breakfast foods being marketed in the country. By examining competitors products it was revealed that the product being marketed by company ‘Y’ is of the highest quality, quick consumption items having much longer shelf-life as compared to other products available in the market. This product was packed in ten containers which after consumption of the contents become scrap without any resale value. He, therefore, decided to make a preproject study to go in for some different type of packing. The study revealed that they can either go in for glass jars or flexi-packs or both. As the product enjoys high quality and has a longer self-life, it can withstand climatic conditions in flexi-packs and thereby drastically reduce expenditure on packaging costs ( in tin containers this is nearly 38 per cent of the total cost of product and by going in for flexi-packs, the same can be reduced to nearly 15 per cent). The saving made in packaging costs can be released to the consumer by way of reducing the price of the product and this reduction in price will not lower the image of the company as the price reduction will be given with the background of change in packaging.\r\n'),
