INSERT INTO `skill_master` (`sm_id`, `e_id`, `jm_id`, `bm_id`, `sub_id`, `skill_name`, `description`) VALUES
(1, 1, 1, 1, 0, 'Java', 'Java is an object-oriented language similar to C++, but simplified to eliminate language features that cause common programming errors. Java source code files (files with a .java extension) are compiled into a format called bytecode (files with a .class extension), which can then be executed by a Java interpreter. Compiled Java code can run on most computers because Java interpreters and runtime environments, known as Java Virtual Machines (VMs), exist for most operating systems, including UNIX, the Macintosh OS, and Windows. Bytecode can also be converted directly into machine language instructions by a just-in-time compiler (JIT).<br>\r\n\r\nJava is a general purpose programming language with a number of features that make the language well suited for use on the World Wide Web. Small Java applications are called Java applets and can be downloaded from a Web server and run on your computer by a Java-compatible Web browser, such as Netscape Navigator or Microsoft Internet Explorer.'),
(2, 2, 3, 1, 0, 'C++', 'C++ (pronounced cee plus plus) is a general purpose programming language. It has imperative, object-oriented and generic programming features, while also providing the facilities for low level memory manipulation.<br>'),
(3, 6, 4, 2, 0, 'PHP', 'PHP ie. Hypertext Preprocessor, an open source, server-side, HTML embedded scripting language used to create dynamic Web pages.<br>\r\n\r\nIn an HTML document, PHP script (similar syntax to that of Perl or C ) is enclosed within special PHP tags. Because PHP is embedded within tags, the author can jump between HTML and PHP (similar to ASP and Cold Fusion) instead of having to rely on heavy amounts of code to output HTML. And, because PHP is executed on the server, the clientcannot view the PHP code.<br>\r\n\r\nPHP can perform any task that any CGI program can do, but its strength lies in its compatibility with many types of databases. Also, PHP can talk across networks using IMAP, SNMP, NNTP, POP3, or HTTP.');
