(60, 7, 'I leave contingency time in my schedule to deal with "the unexpected"?	'),
(60, 8, 'I know whether the tasks I am working on are high, medium, or low value.'),
(60, 9, 'When I am given a new assignment, I analyze it for importance and prioritize it accordingly.'),
(60, 10, 'I am stressed about deadlines and commitments.'),
