(35, 1, 'I try to anticipate and predict possible causes of confusion, and I deal with them up front.	'),
(35, 2, 'When I write a memo, email, or other document, I give all of the background information and detail I can to make sure that my message is understood.	'),
(35, 3, 'If I don''t understand something, I tend to keep this to myself and figure it out later.	'),
(35, 4, 'I''m surprised to find that people haven''t understood what I''ve said.	'),
(35, 5, 'I can tend to say what I think, without worrying about how the other person perceives it. I assume that we''ll be able to work it out later.	'),
(35, 6, 'When people talk to me, I try to see their perspectives.'),
(35, 7, 'I use email to communicate complex issues with people. It''s quick and efficient.	'),
(35, 8, 'When I finish writing a report, memo, or email, I scan it quickly for typos and so forth, and then send it off right away.	'),
(35, 9, 'When talking to people, I pay attention to their body language.	'),
(35, 10, 'I use diagrams and charts to help express my ideas.'),
(35, 11, 'Before I communicate, I think about what the person needs to know, and how best to convey it.'),
(35, 12, 'When someone''s talking to me, I think about what I''m going to say next to make sure I get my point across correctly.	'),
(35, 13, 'Before I send a message, I think about the best way to communicate it (in person, over the phone, in a newsletter, via memo, and so on).'),
(35, 14, 'I try to help people understand the underlying concepts behind the point I am discussing. This reduces misconceptions and increases understanding.'),
(35, 15, 'I consider cultural barriers when planning my communications.'),
(57, 1, 'I usually receive good support from senior executives for changes that I want to implement.'),
(57, 2, 'I create a plan for change for my department and team, and I let other departments deal with the impacts as they choose.'),
(57, 3, 'I communicate successes throughout the organization, so that everyone understands the positive impact of a change project.'),
(57, 4, 'If the change makes financial and operational sense, then it will work.'),
(57, 5, 'If the team is dissatisfied with how something is working or operating right now, change is more likely to be successful.'),
(57, 6, 'I try to understand my organization''s culture and values as important elements of a change project.'),
(57, 7, 'When change is happening, I expect people to continue to perform at 100 percent.'),
(57, 8, 'Once I''m successful with a change project, I declare victory and move onto the next project.'),
(57, 9, 'I consider things like the impact on people and organizational structure when planning a change project.'),
(57, 10, 'If I think something must be changed, I start right away and make it happen.'),
(57, 11, 'To get backing and support from my team, I talk with team members about what is causing the need for change.'),
(57, 12, 'I let people get comfortable with changes before I decide if any training is necessary.'),
(57, 13, 'If key individuals are convinced that change is needed, the rest of the stakeholders will usually come on board.'),
(57, 14, 'It’s harder to manage change effectively when the organization has previously managed change projects badly.'),
(57, 15, 'When implementing a change project, I set achievable, short-term targets that, once accomplished, will motivate people to persist and keep trying.'),
(57, 16, 'Change is as good as a rest, so even though it might not be necessary, it often helps to "mix things up a bit."');
