(3, 'Management', 'IT', 2015, 1, 'Management Information Systems', '<ul><li>Impart knowledge on existing and emerging information technologies and their impact on the IS function </li><li>Critically analyse business processes identify inefficiencies and problems assess information requirements create business solutions and technical specifications for the supporting system</li><li> Effectively evaluate technology alternatives to solve problems in an MIS context </li></ul> ', '<ul><li>Develop an attitude of thinking Creatively</li><li>Develop an attitude of open-mindedness towards needs of customers</li></ul>', '<ul><li>Analytical and Critical Thinking skills Using logic and reasoning to identify the strengths and weaknesses of alternative solutions  conclusions or approaches to problems</li> <li>Systems Analysis  Determining how a system should work and how changes in conditions operations and the environment will affect outcomes</li> <li>Complex Problem Solving  Identifying complex problems and reviewing related information to develop and evaluate options and implement solutions.</li> <li>Ability to think strategically about technology</li> <li>Ability to quickly learn and master new technologies</li> <li>Judgement and Decision Making - Considering the relative costs and benefits of potential actions to choose the most appropriate one.</li></ul>', '<ul><li>To prepare a well-written dissertation/paper OR Documenting/Recording Information</li> <li>Troubleshooting  Determining causes of operating errors and deciding what to do about it</li> <li>Installing updates of software</li> <li>To take Back-up of data frequently</li> <li>Abide by ethical I.T practices </li> <li>Keeping up-to-date technically, seek newer knowledge on development in science and technology </li></ul>'),
(4, 'Management', 'Finance', 2015, 3, ' Financial Markets and Institutions', 'Ability to source historical data on stocks traded at the BSE and NSE Identify what is the risk being faced by a business or the economy and classify under which category it falls Identify what route a business has chosen to raise funds Ability to measure bond yield Identify why a rate cut or rate hike has been initiated by RBI Analyse financial markets and reporting of financial Data', 'Reading newspapers and Magazines to update themselves Critical thinking on finance concepts to predict market trends   Deductive reasoning and problem solving', 'Reading and Comprehension Skills Inductive Reasoning  Ability to combine pieces of information and form general rules or conclusions Using the internet to source information', 'Track the daily movements of Sensex  Nifty Exchange Rate and global oil prices Read about the movement of macro indicators such as GDP growth rate inflation rate Interest rates'),
(5, 'Management', 'Marketing', 2015, 1, 'Marketing Management', 'Knowledge about principles of selling and promoting sales and marketing of products and services Ability to give product demonstration and identify different promotional techniques that the company is using for selling it''s products & services in order to gain competitive Knowledge on attaining customer satisfaction and evaluation of services.  Knowledge and ability to plan strategically, effective resource allocation', 'Develop an attitude of willingly & patiently listen to their customer and solve their queries Develop the attitude of Life Long learning Develop an attitude of critical thinking and problem solving', 'Active listening- become keen listener to what others say ask relevant questions pertaining to current trends in marketing of a product or services   Persuasion develop an ability to persuade and influence others to change their minds or behaviour Critical Thinking- Use of logic and reasoning to identify the strengths and weaknesses of alternative solutions or approaches to problems Social perspective: general awareness of others reaction and understand why they react in a given way Judgement and Decision making- learn to consider the relative costs and benefits of potential actions there by choose the most appropriate one  Develop skills to conduct customer needs assessment', 'Practice and promote professional etiquette and mannerisms Customer friendliness: Maintain a track record and document information about loyal customers Continuously maintain direct contact with customers, update them about latest new offers and discounts Encourage customers feedback on sales, after sales  and services on how they can improve the company''s products and services'),
(6, 'Management', 'HR', 2015, 3, 'Organization Theory, Structure and Design', 'Develop a basic understanding of various elements of an organization and types of organizational designs Understanding and awareness about different Organisational Structure  Understand what are the determinants of organizational structure  Knowledge of business and management principles required in running an organization in various environment ', 'Develop the attitude of abstract thinking and anticipating the change in the organization structure Inquisitive and open mindedness to seek out new ways to support the development of organization', 'Ability to see details in the structure of an organization Decision making skills Use logic and reasoning to judge the strengths and weaknesses of organization structures while modify according to requirement To determine alternative structures to support organisational strategy and environment  Ability to develop an organization chart by understanding the functioning of the organization Become strategically sound i.e. to anticipate things before they happen and getting ready to face any new situation that arises', 'No Components'),
(7, 'Management', 'Finance', 2015, 3, 'Portfolio Management and Security Analysis', 'Conceptual understanding  of financial terms and terminology Understands the working of excel and formula', 'Eager to gain knowledge Willing to accept new information and flexible', 'Can Analyse the financial statements both quantitatively and qualitatively Can solve the problem with effective reasoning and logic', 'Understanding the review of every quarter monetary policy changes by RBI Reading at-least 3 articles per day on financial market and economy from the newspaper such as The Economic Times and Mint');
